import React from 'react';

const AllProductsList = () => {
    return (
        <div className=' p-1'>
          <div className='w-72 bg-white h-80 rounded p-2 shadow-md'>
            <div>
            <img src="https://picsum.photos/200" alt="p" className='w-[100%] object-fill h-[150px] rounded' />
            </div>
            <div>
            <h5 className=' font-monospace'>Computer Monitor</h5>
            </div>
          </div>
        </div>
    );
};

export default AllProductsList;
